const SocialNetwork = ()=>{
    return (
        <>
            <ul className="social_network">
                <FacebookIcon style = {{color : 'white', }}/>
                <li>Facebook</li>
                <li>Instagram</li>
                <li>LinkedIn</li>
                <li>Twitter</li>
